       startbeta(1)
    elseif available.cwm.ver == "enchanced" then
       startenchanced(1)
    elseif available.cwm.ver == "legacy" then
       startlegacy(1)
      end
    elseif not getgenv().key or not available.cwm.key then
       print("unable to identify key")
   end
end
